import React from "react";
import "./MainImg.css";
import Carousel from "react-bootstrap/Carousel";
import ExampleCarouselImage from "./ExampleCarouselImage";

const MainImg = () => {
  return (
    <div>
      <div className="mask">
        <Carousel fade>
          <Carousel.Item className="image-container">
            <video className="d-block w-100" autoPlay loop muted>
              <source
                src="https://images.unsplash.com/photo-1706954668876-44410ebbbfa8?q=80&w=1888&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
                type="video/mp4"
              />
              Your browser does not support the video tag.
            </video>
          </Carousel.Item>
          <Carousel.Item className="image-container">
            <ExampleCarouselImage img="https://via.placeholder.com/800x400?text=Second+Slide" />
          </Carousel.Item>
          <Carousel.Item className="image-container">
            <ExampleCarouselImage img="https://via.placeholder.com/800x400?text=Third+Slide" />
          </Carousel.Item>
        </Carousel>
      </div>
    </div>
  );
};

export default MainImg;
